import { useRouter } from 'next/router';
import Layout from '../components/Layout';

export default function Post() {
  const router = useRouter();

  return (
    <Layout>
      <div className="detail-news">
        <h1 className="font-35 text-center has-text-weight-semibold">
          Saling Ejek, Nelayan Pasuruan Dibacok di Sidoarjo
        </h1>
        <div className="bottom-line-black-50 m-b-20" />
        <div className="w-75 text-center" style={{ margin: 'auto', 'background-color':'#ededed'  }}>
          <img src="https://api.jatimnet.com/jinet/assets/media/news/news/image_front/PERESMIAN_MERR_DILAKUKAN_RISMA.jpg" className="w-100" />
          <p className="p-h-10 font-15 p-b-10">
            JALAN MERR: Wali Kota Surabaya Tri Rismaharini meresmikan Jalan Middle East Ring Road (MERR) IIC Gunung Anyar sisi barat, Sabtu 15 Februari 2020. Foto: Humas Pemkot Surabaya
          </p>
        </div>
      </div>
    </Layout>
  );
}
